INSERT INTO `cms` VALUES (1,'home','<p>Měření veličin spojených s povrchovým odtokem je velmi důležité v povrchové hydrologii. Měřená data představují nenahraditelný zdroj potřebný pro kalibraci a validaci matematických modelů, bez nichž není možné docílit přesných předpovědí a modely se tak stávají bezcennými. Náklady spojené se sběrem takových dat jsou však často neúměrně vysoké … buď je nutné založit experimentální povodí, vybavit měřicí a záznamovou technikou a následně vše udržovat v dobrém stavu a čekat na příchod významných přírodních srážkových událostí, nebo je možné postavit dešťový simulátor a provádět polní nebo laboratorní experimenty. Obě varianty bývají náročné na lidskou sílu a čas a získání dostatečně velkého datasetu pro pokrytí potřebného rozsahu hodnot vstupních parametrů je pro jeden výzkumný tým/projekt často nemožné …<br>\r\n… sdílení dat a metodik může pomoci nám všem!</p>\r\n<p>Tento projekt chce poskytnout otevřenou platformu pro sběr a sdílení měřených dat spojených se srážko-odtokovými událostmi. Každé experimentální povodí a dešťový simulátor jsou unikátní a stejně tak se různí postupy pro měření, záznam, zpracování a využití dat. Jednotné využívání dat z různých zdrojů pro vzájemné porovnání nebo pro společný účel může být velmi náročné právě kvůli různým metodám pro zpracování a ukládání dat na různých pracovištích. Tato databáze se snaží poskytnout dostatečně robustní a vnitřně provázanou strukturu pro ukládání měřených dat spolu s jejich metadaty, vzájemnými vztahy mezi odvozenými datovými sety a dalšími informacemi o metodách sběru a zpracování uložených dat podle principů definovaných ve <a href=\"https://www.go-fair.org/fair-principles/\" target=\"_blank\">“FAIR Guiding Principles for scientific data management and stewardship”</a>.</p>\r\n<p>Konzistentní struktura dat uložených na jednom místě poskytuje možnosti implementace automatizovaných nástrojů pro manipulaci s těmito dat podle dané úlohy, například vytváření tabelovaných setů vstupních parametrů pro kalibrační běhy matematického modelu. Jakmile je takový nástroj vytvořen, je možné kalibrační dataset kdykoliv znovu vygenerovat během okamžiku, jakmile je databáze měření rozšířena.</p>\r\n<p>Databáze je vytvořena v jazyce MySQL a zahrnuje samotná měření, jejich metadata, informace o výzkumných týmech, dešťových simulátorech, ale i zdrojích financování jednotlivých kampaní. Registrovaným uživateům je poskytnuta možnost stažení exportu dat  ve strukturovaném formátu XML, který je možné dále zpracovat v libovolném programovacím jazyce (PHP, pytthon, R ... ).</p>\r\n<p>Vznik databáze byl podpořen výzkumným projektem <strong>QK1810341</strong> Národní agentury zemědělského výzkumu.</p>','cs','Vítejte na stránkách databáze měření povrchových hydrologických jevů – RunoffDB','content','draft'),(2,'home','Measuring data related to runoff events is an important activity for surface hydrology. These data provide valuable resource for calibrating and validating mathematical models and are necessary to make the models accurate and useful. But the expenses to collect such data are tremendously high … you either need to instrument a natural watershed, keep it in a good condition and wait for natural rainfall events to occur or you construct a rainfall simulator and execute in situ or lab experiments, both of which can be high stuff and time demanding. Collecting a dataset large enough to cover sufficient range of input parameters can be not feasible for a single research team …\r\n… let’s share the data and methodologies and we all can benefit from that!\r\nThis project wants to provide an open platform for collecting and sharing rainfall-runoff related measurements, both natural and artificial in a consistent manner. Every instrumented watershed and every rainfall simulator is different and so are the methods for data collection, recording, processing and utilization. Mining the data from different sources for comparison or a common purpose can be quite exhausting as all the teams and workers use different software, workflows and structures for storing the data. This database is an attempt to provide a robust structure for storing and sharing experimental data together with its metadata, relationships between data sets and other information about the data collection and preprocessing following the <a href=\"https://www.go-fair.org/fair-principles/\" target=\"_blank\">“FAIR Guiding Principles for scientific data management and stewardship”</a>.\r\nHaving all the data stored at one place in a consistent manner allows for automated tools to be used to retrieve the data in desired structures needed for a particular utilization e.g. calibration data sheet for a certain model. Once the mining tool is ready the calibration sheet can be automatically regenerated in a snap every time the DB grows.\r\nThe database is MySQL based including the metadata related to the measurements themselves, the research teams and rainfall simulators as well as the funding sources. Registred users have the possibility to download XML structured export of the DB contents that can be further processed in ones favorite working environment (R, PHP, python  etc.).\r\nThe research has been supported by the research project <span data-toggle=\"tooltip\" class=\"tip\" data-placement=\"top\" title=\"Projekt\">QK1810341</span> of Czech National Agricultural Research Agency','en','Welcome to the Run-off Database site!','content','draft'),(7,'simulators','Vítr skoro nefouká a tak by se na první pohled mohlo zdát, že se balónky snad vůbec nepohybují. Jenom tak klidně levitují ve vzduchu. Jelikož slunce jasně září a na obloze byste od východu k západu hledali mráček marně, balónky působí jako jakási fata morgána uprostřed pouště. Zkrátka široko daleko nikde nic, jen zelenkavá tráva, jasně modrá obloha a tři křiklavě barevné pouťové balónky, které se téměř nepozorovatelně pohupují ani ne moc vysoko, ani moc nízko nad zemí. Kdyby pod balónky nebyla sytě zelenkavá tráva, ale třeba suchá silnice či beton, možná by bylo vidět jejich barevné stíny - to jak přes poloprůsvitné barevné balónky prochází ostré sluneční paprsky.\r\n\r\nJenže kvůli všudy přítomné trávě jsou stíny balónků sotva vidět, natož aby šlo rozeznat, jakou barvu tyto stíny mají. Uvidět tak balónky náhodný kolemjdoucí, jistě by si pomyslel, že už tu takhle poletují snad tisíc let. Stále si víceméně drží výšku a ani do stran se příliš nepohybují. Proti slunci to vypadá, že se slunce pohybuje k západu rychleji než balónky, a možná to tak skutečně je. Nejeden filozof by mohl tvrdit, že balónky se sluncem závodí, ale fyzikové by to jistě vyvrátili. Z fyzikálního pohledu totiž balónky působí zcela nezajímavě.','cs','Dešťové simulátory','content','published'),(8,'test','...','cs','test','content','draft');
/*!40000 ALTER TABLE `cms` ENABLE KEYS */;
